INSERT INTO `athlete` VALUES ('182', '532', '', 'Novak Djokovic', 'Nole', '1', '1', '1', '10955', 'Serbia', 'RS', '31', 'Monte Carlo, Monaco', '2003', '05 22, 1987', '188', '80', '0', '17', '0', '0', 'http://www.novakdjokovic.rs/index.php?jezik=2', '2019-02-20 13:05:30', '2019-02-26 13:15:50', 'One of the greatest players ever to pick up a racquet, Novak Djokovic won his first Grand Slam title at the 2008 Australian Open, defeating Jo-Wilfried Tsonga in four sets in the final. The Serb won his first Wimbledon and first U.S. Open in 2011, and in 2016 he completed the career Grand Slam by ousting Andy Murray in the Roland Garros final. With that title, Djokovic held all four Grand Slams at once, and he had a 30-match Grand Slam winning streak until Sam Querrey beat him in the third round of Wimbledon in 2016. Djokovic, who reached No. 1 in the world for the first time on July 4, 2011, is known for his remarkable all-court play, aggressive baseline skills, tremendous stamina and unparalleled consistency. He is a terrific defensive player and one of\r\nthe fittest men on tour, and he’s developed a very dangerous serve over the years. ', '{\"single\":[{\"year\":\"2017\",\"tournament\":\"Doha, Eastbourne  \"},{\"year\":\"2016\",\"tournament\":\"Doha, Australian Open, Indian Wells, Miami, Madrid, French Open, Toronto     \"},{\"year\":\"2015\",\"tournament\":\"Australian Open, Indian Wells, Miami, Mont\r\ne Carlo, Rome, Wimbledon, Beijing, Shanghai, Paris, ATP World Tour Finals\"},{\"year\":\"2014\",\"tournament\":\"ATP World Tour Finals, Paris, Beijing, Wimbledon, Rome, Miami, Indian Wells\"},{\"year\":\"2013\",\"tournament\":\"ATP World Tour Finals, Paris, Shanghai, Beijing, Monte Carlo, Dubai, Australian Open\"},{\"year\":\"2012\",\"tournament\":\"ATP World Tour Finals, Shanghai, Beijing, Toronto, Miami, Australian Open\"},{\"year\":\"2011\",\"tournament\":\"U.S. Open, Montreal, Wimbledon, Rome, Madrid, Belgrade, Miami, Indian Wells, Dubai, Australian Open\"},{\"year\":\"2010\",\"tournament\":\"Beijing, Dubai \"},{\"year\":\"2009\",\"tournament\":\"Paris, Basel, Beijing, Belgrade, Dubai \"},{\"year\":\"2008\",\"tournament\":\"ATP Championships, Rome, Indian Wells, Australian Open \"},{\"year\":\"2007\",\"tournament\":\"Vienna, Canada, E\r\nstoril, Miami, Adelaide \"},{\"year\":\"2006\",\"tournament\":\"Metz, Amersfoort \"}],\"double\":[{\"year\":\"2010\",\"tournament\":\"London / Queen\'s Club\"}]}', '2019-02-26 17:55:06');
